"   </div>",
"   <div class=\"lgnd\">",
"    These images illustrate the benefits of spot compression and magnification. In the left panel (A), a medial lateral oblique (MLO) mammographic image, there is a mass at the posterior edge of the film (arrows) which is incompletely characterized. The borders of the lesion can be better characterized with regional spot compression and magnification. The spot magnification MLO view (B) shows that the lesion has irregular borders and spiculation. In addition, associated microcalcifications are seen. The lesion can now be characterized as suspicious, BIRADS 4c, requiring biopsy. Pathology revealed infiltrating duct cell carcinoma with papillary features.",
