"   <div id=\"basicsTopicLeft\">",
"    <div id=\"topicTitle\">",
"     Patient information: Temporomandibular joint (TMJ) disorders (The Basics)",
"    </div>",
"    <span class=\"view\">",
"     View in",
"     <a class=\"lang\" href=\"./es-419/temporomandibular-joint-tmj-disorders-the-basics?source=topic_page\">",
"      Spanish",
"     </a>",
"    </span>",
"    <a class=\"contributor contributor_credentials\" href=\"./authors-and-editors/patient-information\">",
"     Written by the doctors and editors at UpToDate",
"    </a>",
"    <div id=\"topicText\">",
"     <p class=\"headingAnchor\" id=\"H13954786\">",
"      <span class=\"h1\">",
"       What are temporomandibular joint disorders?",
"      </span>",
"      &nbsp;&mdash;&nbsp;Temporomandibular joint disorders are problems with the jaw joint and the muscles around it. The jaw joint, called the &ldquo;temporomandibular joint,&rdquo; is located in front of the ear where the jawbone connects to your head. To feel the joint, place your finger on your cheek just in front of your ear and then open and close your mouth.",
"     </p>",
"     <p>",
"      When doctors refer to temporomandibular joint disorders, they often call it &ldquo;TMJ,&rdquo; for short. TMJ can be caused by many problems, including arthritis. More often it is due to a combination of stress, jaw clenching, teeth grinding, and other things that strain the jaw joint and the muscles around it.",
"     </p>",
"     <p class=\"headingAnchor\" id=\"H13954801\">",
"      <span class=\"h1\">",
"       What are the symptoms of TMJ?",
"      </span>",
"      &nbsp;&mdash;&nbsp;The main symptom of TMJ is a dull pain in the jaw muscles that doesn&rsquo;t go away. The pain is often on just one side of the face, near the ear. Sometimes the pain also affects the ear, jaw, or back of the neck. It is usually worse when chewing. Some people just have headaches with TMJ. Others might hear a clicking or popping sound or have a &ldquo;crunchy feeling&rdquo; in the joint when they open and close their mouth.",
"     </p>",
"     <p class=\"headingAnchor\" id=\"H13954816\">",
"      <span class=\"h1\">",
"       Should I see a doctor or nurse?",
"      </span>",
"      &nbsp;&mdash;&nbsp;If the pain in your face or jaw is bothering you and does not go away, you should see your doctor or nurse.",
"     </p>",
"     <p class=\"headingAnchor\" id=\"H13954831\">",
"      <span class=\"h1\">",
"       What tests might I need?",
"      </span>",
"      &nbsp;&mdash;&nbsp;There is no single test that can show if you have TMJ. Your doctor or nurse should be able to tell if you have TMJ by learning about your symptoms and doing an exam.",
"     </p>",
"     <p>",
"      Unless the doctor finds something unusual in the exam, most patients will NOT need X-rays or an MRI (an imaging test that creates pictures of the inside of your body). &nbsp;",
"     </p>",
"     <p class=\"headingAnchor\" id=\"H13954846\">",
"      <span class=\"h1\">",
"       How is TMJ treated?",
"      </span>",
"      &nbsp;&mdash;&nbsp;No single treatment for TMJ works for everyone. Most of the time, medicines and simple lifestyle changes can help. Most patients get better over time, even without treatment, so patience is important.",
"     </p>",
"     <p>",
"      Your doctor or nurse will help you find the right mix of treatments for you. He or she might refer you to a dentist who specializes in TMJ. Treatment options include:",
"     </p>",
"     <p>",
"      <ul class=\"bullet-block\">",
"       <li>",
"        Medicines to relieve pain and relax the muscles &ndash; There are several types of medicines used to treat TMJ. These include nonsteroidal anti-inflammatory drugs (NSAIDs), muscle relaxants, and certain medicines used for depression. (Medicines for depression can relieve pain even in people who are not depressed.) Your doctor will decide which medicine or group of medicines is best for you.",
"       </li>",
"       <li>",
"        Jaw exercises &ndash; There are simple jaw exercises that seem to help some people. Ask your doctor to show you how to do them.",
"       </li>",
"       <li>",
"        Bite",
"        <span class=\"nowrap\">",
"         plates/splints",
"        </span>",
"        &ndash; These are special devices that fit in your mouth and keep you from grinding your teeth at night. They are made out of either a hard or soft plastic and might be made specially to fit your mouth. If you have sleep apnea, be sure to tell your doctor as the bite plate or splint might make your sleep apnea worse.",
"       </li>",
"      </ul>",
"     </p>",
"     <p>",
"      If these treatments don&rsquo;t help, your doctor might suggest that you see a specialist, such as an oral surgeon. The specialist might use medicines given by injection (shots) to treat the pain. It is rare that people need surgery for TMJ.",
"     </p>",
"     <p class=\"headingAnchor\" id=\"H13954861\">",
"      <span class=\"h1\">",
"       Is there anything I can do on my own to feel better?",
"      </span>",
"      &nbsp;&mdash;&nbsp;Yes. You might feel better if you:",
"     </p>",
"     <p>",
"      <ul class=\"bullet-block\">",
"       <li>",
"        Avoid doing things that make the pain worse, such opening your mouth too wide.",
"       </li>",
"       <li>",
"        Eat soft foods that don&rsquo;t require a lot of chewing.",
"       </li>",
"       <li>",
"        Practice relaxing &ndash; You can learn methods to relax your body, such as doing deep breathing exercises. Ask your doctor or nurse about these methods. Relaxing the mind can help with how the body feels pain. People can learn to quiet their pain or make it less bothersome.",
"       </li>",
"       <li>",
"        Use ice packs to ease the pain &ndash; Use a bag of ice, bag of frozen peas, or cold gel pack once every 2 hours, for 20 minutes each time. Put a towel or cloth between the ice and your skin. Do not put the ice directly on your skin.",
"       </li>",
"       <li>",
"        Put heat on the painful area &ndash; Wet a clean washcloth with warm water and put it on the area. When the washcloth cools, reheat it with warm water and put it back on. Repeat these steps for 10 to 15 minutes every few hours.",
"       </li>",
"       <li>",
"        Avoid stimulants, such as coffee, tea, colas, or decongestant medicines, since these can make your anxiety worse.",
"       </li>",
"      </ul>",
"     </p>",
"     <p class=\"headingAnchor\" id=\"H13954876\">",
"      <span class=\"h1\">",
"       More on this topic",
"      </span>",
"     </p>",
"     <p>",
"      <a class=\"medical medical_basics\" href=\"mobipreview.htm?23/12/23746?source=see_link\">",
"       Patient information: Chronic pain (The Basics)",
"      </a>",
"     </p>",
