var title_f35_35_36407="Abdominal aortic aneurysm with crescent sign";
var content_f35_35_36407=[" <div id=\"graphicsToolbar\">",
"  <div id=\"graphicsCopy\">",
"   &copy;2013 UpToDate",
"   <sup>",
"    &reg;",
"   </sup>",
"  </div>",
"  <div id=\"graphicsLinks\">",
"   <a href=\"?imageKey=RADIOL%2F87324&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=1\" onclick=\"\">",
"    <img alt=\"Print this page\" src=\"./../images/icn_print.myextg\" title=\"Print this page\"/>",
"   </a>",
"   <a class=\"icontxt textLink\" href=\"?imageKey=RADIOL%2F87324&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=1\" onclick=\"\" title=\"Print this page\">",
"    Print",
"   </a>",
"   <a class=\"etacLink\" href=\"#\">",
"    <img alt=\"Email graphic(s)\" src=\"./../images/icn_email.myextg\" title=\"Email graphic(s)\"/>",
"   </a>",
"   <a class=\"icontxt textLink etacLink\" href=\"#\" title=\"Email graphic(s)\">",
"    Email",
"   </a>",
"  </div>",
" </div>",
" <div class=\"graphic\">",
"  <div class=\"figure\" style=\"width: 592px\">",
"   <div class=\"ttl\">",
"    Abdominal aortic aneurysm with crescent sign",
"   </div>",
"   <div class=\"cntnt\" style=\"width: 572px; height: 495px; background-image: url(data:image/jpeg;base64,);\">",
"   </div>",
"   <div class=\"lgnd\">",
"    These images&nbsp;show a&nbsp;large infrarenal aortic aneurysm in a 77-year-old male.&nbsp;The lumen of the aorta can be appreciated&nbsp;in panel A&nbsp;(arrow) and is surrounded by mural thrombus. A hyperdense crescent can be seen within the thrombus in panel B (arrowhead) suggesting acute hemorrhage within the thrombus. This finding suggests an unstable AAA with impending rupture. Narrow windows (C and D) are used to accentuate the high density crescent sign (arrowhead in D).",
"    <div class=\"footnotes\">",
"     AAA: abdominal aortic aneurysm.",
"    </div>",
"    <div class=\"reference\">",
"    </div>",
"   </div>",
"  </div>",
" </div>",
"</div>"].join("\n");
