" <div class=\"graphic\">",
"  <div class=\"figure\" style=\"width: 470px\">",
"   <div class=\"ttl\">",
"    Veins of the pelvis",
"   </div>",
"   <div class=\"cntnt\" style=\"width: 410px; height: 593px; background-image: url(data:image/jpeg;base64,);\">",
"   </div>",
"   <div class=\"lgnd\">",
"    The patterns of the portal and systemic (vena caval) venous systems of the abdominopelvic cavity are shown. Venous drainage from pelvic organs flows mainly to the caval system via the internal iliac veins. The upper rectum normally drains into the portal system, although the superior rectal veins anastomose with the middle and inferior rectal veins, which are tributaries of the internal iliac veins.",
"    <div class=\"footnotes\">",
