"       Any N",
"      </td>",
"      <td>",
"       M1",
"      </td>",
"     </tr>",
"    </table>",
"   </div>",
"   <div class=\"lgnd\">",
"    Note: Uterine carcinosarcomas are staged using the system for uterine carcinoma.",
"    <br>",
"     Note: cTNM is the clinical classification, pTNM is the pathologic classification.",
"     <div class=\"footnotes\">",
"      * Simultaneous tumors of the uterine corpus and ovary/pelvis in association with ovarian/pelvic endometriosis should be classified as independent primary tumors.",
"      <br>",
"       &bull; In this stage lesions must infiltrate abdominal tissues and not just protrude into the abdominal cavity.",
"       <br>",
"        &Delta; Stage IA and IB are different for leiomyosarcoma / endometrial stromal sarcoma than for adenosarcoma.",
"        <br>",
"         &loz; Stage IC does not apply for leiomyosarcoma and endometrial stromal sarcoma.",
"        </br>",
"       </br>",
"      </br>",
"     </div>",
"     <div class=\"reference\">",
